import React, { useEffect, useState } from 'react'
import axios from 'axios'




function Weather() {
    // react hook on state
    const [danePogodowe, setDanePogodowe] = useState([])

    useEffect(() => {

        const getData = () => {
            axios
                .get('https://danepubliczne.imgw.pl/api/data/synop/')
                .then((dane) => {
                    console.log(dane.data);
                    setDanePogodowe(dane.data)
                })
                .catch((error) => {
                    console.log(error);
                    return null;
                })
        }
        getData();

    }, [])




    return (
        <div>

            <div>Dane pogodowe</div>
            <div>
                {
                    // danePogodowe.map(({id_stacja, stacja }) => {return <div key={id_stacji}})
                    danePogodowe.map(({ stacja, temperatura, cisnienie }) => { return <div>{temperatura, cisnienie}</div> })
                }
            </div>
        </div>
    )
}

export default Weather
